  render() {
    return (
      <Link
        to="/signin" /*style={{borderRightWidth: '3px', borderRightColor:'black', borderRightStyle: 'dashed'}}*/
      >
        <i
          className="far fa-user fa-3x"
          style={{ width: "50px", position: "absolute", right: "0%" }}
        ></i>
      </Link>
    );
  }
}

const condition = authUser  => !!authUser
export default withA(Icon);
